import React from 'react';
import {  Link } from 'react-router-dom';

class About extends React.Component {
  render() {
    return(
      <nav>
        <Link to='/'>Home</Link>
        <Link to='/about'>About</Link>
        <Link to='/favorites'>FavoritePokemons</Link>
      </nav>
    )
  }
}

export default About;
